import React,{Component} from 'react';
import {
    Navbar,
    Input,
    Button,
    InputGroup,
    InputGroupAddon,
    Container,
    Col,
    Row,
    Form
} from 'reactstrap';
class Home extends Component{
    render(){
        return (
            <>
                <Navbar color="dark" fixed="bottom">
                    <Container className="d-flex justify-content-center">
                        <Col xs="12" md="6">
                            <Form>
                            <InputGroup>
                                <Input />
                                    <InputGroupAddon addonType="append">
                                        <Button color="danger">OI</Button>
                                    </InputGroupAddon>
                            </InputGroup>
                            </Form>
                        </Col>
                    </Container>
                </Navbar>
            </>
        );
    }
}
export default Home;
